import React from 'react';
import { Container } from '@material-ui/core';
import * as common from './common';

function BizHeader() {
  return (
    <Container style={{backgroundColor: common.colorPrimary, color: "#FFF"}}>
      <h1>AYaSoNice Authentic Jamaican Food</h1>
    </Container>
  );
}

export default BizHeader;
